import React from "react";

const VideoItem = ({ video }) => {
  // accessig the video title from the API
  return (
    <div className="item">
      <img src={video.snippet.thumbnails.medium.url} />
      {video.snippet.title}
    </div>
  );
};

export default VideoItem;
